import React from 'react';
import data from "../../data/index.json"; // Assuming data contains an array of skills and descriptions
import "../../styles/skills.css";

export default function MySkills() {
  return (
    <section className="skills-section" id="mySkills">
      <div className="portfolio-container">
        <p className="section-title">My Skills</p>
        <h2 className="skills-section-heading">My Expertise</h2>
      </div>
      <div className="skills-section-container">
        {/* Render skills in the first 2 rows */}
        {data?.skills?.slice(0, 6).map((item, index) => (
          <div key={index} className="skills-section-card">
            <div className="skills-section-img">
              <img src={item.src} alt="Skill" />
            </div>
            <div className="skills-section-card-content">
              <h3 className="skills-section-title">{item.title}</h3>
            </div>
          </div>
        ))}
      </div>
      <div className="description-container">
        {/* Render descriptions in the last column */}
        {data?.descriptions?.slice(0, 3).map((description, index) => (
          <div key={index} className="description-item">
            <h3 className="description-title">{description.title}</h3>
            <p className="description">{description.text}</p>
          </div>
        ))}
      </div>
    </section>
  );
}
